import React, { useRef } from "react";
import { useGLTF } from "drei";

const AnimatedWoman = () => {
  const gltf = useGLTF("../public/models/Animated Woman.glb");

  const group = useRef();

  return <primitive object={gltf.scene} ref={group} />;
};

export default AnimatedWoman;
